INSERT INTO `preventivo` VALUES (1,2,1,'RIV/16316','2016-03-22',2.00,'','SOSTITUZIONE RIV15801',0,'2016-04-04 18:55:01',6),(4,72,1,'RIV/16317','2016-03-21',121441.68,'','al 21/3 Alessia Dima ci ha passato richiesta per fare proforma mobili Giardino italiano. Le foto ricevute, caso strano, sono del cliente Expotorg (RIV/141122) e Persona Home Decor (RIV/15431). Fattto proforma con sconto 50+10% da mostrare a cliente finale, ma per Sig.ra Fatima promesso ulteriore 5% fino all\\\'11/4. al 7/4 cliente ha richiesto prezzi di altra merce per decidere cosa poi inserire nella proforma finale. Privata finale chiedeva sconto più alto ma risposto ad Alessia che noi trattiamo con Sig.ra Fatima.\r\n8/4 ha scritto cliente dicendo che tavolino art 7357 speciale misure 60x60 non vuole pagare sovrapprezzo, detto ad Alessia Dima che non possiamo dare prezzo standard x uno speciale, in quanto abbiamo anche già tolto l\'overcharge x special finitura season e sconto extra 5% su proforma.\r\nIn fiera ha fatto modifiche cambiato importo e Francesco ha concesso il 10% extra anzichè il 5%.\r\n26/4 fatto ulteriori modifiche per proforma finale\r\n2/5 sistemato file con sconto +10% per SIG.RA FATIMA',0,'2016-05-02 11:34:55',10),(5,3,1,'MARIO1','2016-04-13',100.00,'','test',0,'2016-04-13 18:38:23',1),(6,72,1,'RIV/16409','2016-04-08',132876.86,'','in data 8/4 fatto prima proforma con importo di 176.660,95 secondo mail inviata da Alessia Dima.\r\n14/4 Durate fiera cliente è passata e ha fatto modifiche e Francesco ha concesso sconto extra 10% anzichè il 5%\r\n26/4 cliente ha fatto ulteriori modifiche x file finale\r\n2/5 sistemato file con sconto +10% x SIG.RA FATIMA',0,'2016-05-02 11:34:22',10),(7,276,1,'RIV/16411','2016-04-13',157632.89,'','cliente passato in fiera e fatto ordine per showroom e confermato. Sconto 50+10+10\r\n10/6 tolto divano art 2144',0,'2016-06-15 17:29:23',10),(8,277,1,'RIV/16119','2016-04-18',170028.79,'','sconto speciale 50+5+3%\r\ncommissioni Dima 10%\r\n2/5/2016 cambiat